import React, { Component } from 'react';

import { Button } from 'react-bootstrap';

import './Home.css';
// import styles from './Home.css';

export default class Home extends Component {
	render() {
		return (
			<div className="container">
				<div className={styles.headerTitle}>
					<h1>SpotiFood</h1>
				</div>
			</div>
		);
	}
}
